		//פונקציה ליצירת הטיימר שתשמש למשוב המסכם בסיום המשחק
		function gameTimer() {
			//קידום השניות
			seconds++;
			//אם הגענו ל60 שניות, נרצה לקדם באחד את הדקות
			if (seconds == 60) {
				seconds = 0;
				minutes++;
				//אם עברנו 60 דק', נקדם את השעה
				if (minutes == 60) {
					minutes = 0;
				}
			}
		}
		
