			//תנאי - רק אם כבר הפעילו את האינטרוול של העלייה למעלה, תנטרל אותו
			if (goingUp == true) {
				clearInterval(stairMoveInterval); //השהיית האינטרוול של המדרגות הזזות
				selfHome.bricks.stop(); //השהיית הלבנים הזזות ברקע
			}
		
			//תנאי - רק אם האוואטר בזמן קפיצה, תנטרל את האינטרוול שלו
			if (checkJump == true) {
				clearInterval(avatarInterval); //השהיית האינטרוול לקפיצה של האוואטר
			}
		
